INSERT INTO `wp_postmeta` VALUES("323", "218", "panels_data", "a:3:{s:7:\"widgets\";a:2:{i:0;a:5:{s:4:\"type\";s:6:\"visual\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:1120:\"<p>[spacer height=\"50px\"]</p><p><strong>About CISSA</strong><br /> The Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!</p><p>[spacer height=\"5px\"]</p><p><strong>Our Goals</strong><br /> 1.Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.<br /> 2.Encourage students to further their education through technical events such as programming competitions.<br /> 3. Connect students with potential employers looking to meet high quality graduates.</p><p>[spacer height=\"5px\"]</p><p><strong>Our Committee</strong></p><p>[table id=1 /]</p><p>[spacer height=\"150px\"]</p>\";s:6:\"filter\";s:1:\"1\";s:11:\"panels_info\";a:6:{s:5:\"class\";s:30:\"WP_Widget_Black_Studio_TinyMCE\";s:3:\"raw\";b:0;s:4:\"grid\";i:0;s:4:\"cell\";i:0;s:2:\"id\";i:0;s:5:\"style\";a:1:{s:18:\"background_display\";s:4:\"tile\";}}}i:1;a:5:{s:4:\"type\";s:6:\"visual\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:530:\"<p>[spacer height=\"15px\"]</p><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\" /></a></p><p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\" /></a></p>\";s:6:\"filter\";s:1:\"1\";s:11:\"panels_info\";a:6:{s:5:\"class\";s:30:\"WP_Widget_Black_Studio_TinyMCE\";s:3:\"raw\";b:0;s:4:\"grid\";i:1;s:4:\"cell\";i:0;s:2:\"id\";i:1;s:5:\"style\";a:1:{s:18:\"background_display\";s:4:\"tile\";}}}}s:5:\"grids\";a:2:{i:0;a:2:{s:5:\"cells\";i:1;s:5:\"style\";a:0:{}}i:1;a:2:{s:5:\"cells\";i:2;s:5:\"style\";a:0:{}}}s:10:\"grid_cells\";a:3:{i:0;a:2:{s:4:\"grid\";i:0;s:6:\"weight\";i:1;}i:1;a:2:{s:4:\"grid\";i:1;s:6:\"weight\";d:0.5;}i:2;a:2:{s:4:\"grid\";i:1;s:6:\"weight\";d:0.5;}}}");
