INSERT INTO `wp_postmeta` VALUES("429", "291", "panels_data", "a:3:{s:7:\"widgets\";a:2:{i:0;a:5:{s:4:\"type\";s:4:\"html\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:1168:\"[spacer height=\"10px\"]\n\n<span class=\"home-making\">About CISSA</span>\n[spacer height=\"2px\"]\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\n\n[spacer height=\"5px\"]\n\n<span class=\"home-making\">Our Goals</span>\n[spacer height=\"2px\"]\n1.Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\n2.Encourage students to further their education through technical events such as programming competitions.\n3. Connect students with potential employers looking to meet high quality graduates.\n\n[spacer height=\"5px\"]\n\n<span class=\"home-making\">Our Committee</span>\n[spacer height=\"2px\"]\n\n[table id=1 /]\n\n[spacer height=\"100px\"]\";s:6:\"filter\";s:1:\"1\";s:11:\"panels_info\";a:5:{s:5:\"class\";s:30:\"WP_Widget_Black_Studio_TinyMCE\";s:4:\"grid\";i:0;s:4:\"cell\";i:0;s:2:\"id\";i:0;s:5:\"style\";a:2:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";}}}i:1;a:5:{s:4:\"type\";s:6:\"visual\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:530:\"<p>[spacer height=\"15px\"]</p><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\" /></a></p><p><