INSERT INTO `wp_posts` VALUES("19", "1", "2015-07-01 04:14:08", "2015-07-01 04:14:08", "This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/CISSA/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!", "Sample Page", "", "inherit", "open", "open", "", "2-revision-v1", "", "", "2015-07-01 04:14:08", "2015-07-01 04:14:08", "", "2", "http://localhost/CISSA/index.php/2015/07/01/2-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("20", "1", "2015-07-01 04:14:24", "2015-07-01 04:14:24", "<span style=\"display:block;clear:both;height: 0px;padding-top: 10px;\"></span>\r\n\r\n<span class=\"home-making\">About CISSA</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 2px;\"></span>\r\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n\r\n<span class=\"home-making\">Our Goals</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 2px;\"></span>\r\n1.&nbsp;Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n2.&nbsp;Encourage students to further their education through technical events such as programming competitions.\r\n3. Connect students with potential employers looking to meet high quality graduates.\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n\r\n<span class=\"home-making\">Our Committee</span>\r\n\r\n[table id=1 /]\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 100px;\"></span><span style=\"display:block;clear:both;height: 0px;padding-top: 15px;\"></span><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a></p><p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a></p>&nbsp;", "About", "", "publish", "closed", "open", "", "about", "", "", "2015-07-04 06:48:58", "2015-07-04 06:48:58", "", "0", "http://localhost/CISSA/?page_id=20", "0", "page", "", "0");
