INSERT INTO `wp_posts` VALUES("24", "1", "2015-07-01 04:14:48", "2015-07-01 04:14:48", "<span class=\"home-making\">Upcoming Events</span>\r\n\r\n<a href=\"https://www.facebook.com/events/932158913503545/\"><img class=\"alignnone wp-image-265\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/codebrew.png\" alt=\"codebrew\" width=\"657\" height=\"243\" /></a>\r\n<p style=\"text-align: center;\"><a href=\"https://www.facebook.com/events/932158913503545/\"><strong>CodeBrew</strong></a></p>\r\nCodeBrew is a Melbourne-based weekend-long hackathon for university students run by CISSA. It will hosted on <em>Friday, August 7</em> and at <em>York Butter Factory, 66 King Street, Melbourne, Victoria, Australia 3000.</em> <a href=\"http://codebrew.net.au/tickets\">Obtain tickets</a>\r\n<p class=\"affiliation\">Affiliations</p>\r\n<a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\" /></a> <a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\" /></a>", "Events", "", "publish", "closed", "open", "", "event", "", "", "2015-07-09 04:24:55", "2015-07-09 04:24:55", "", "0", "http://localhost/CISSA/?page_id=24", "0", "page", "", "0");
