INSERT INTO `wp_posts` VALUES("104", "1", "2015-07-04 06:42:26", "2015-07-04 06:42:26", "<span style=\"display:block;clear:both;height: 0px;padding-top: 50px;\"></span><p><strong>About CISSA</strong><br> The Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!</p><span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span><p><strong>Our Goals</strong><br> 1.&nbsp;Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.<br> 2.&nbsp;Encourage students to further their education through technical events such as programming competitions.<br> 3. Connect students with potential employers looking to meet high quality graduates.</p><span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span><p><strong>Our Committee</strong></p><p>[table id=1 /]</p><span style=\"display:block;clear:both;height: 0px;padding-top: 100px;\"></span><span style=\"display:block;clear:both;height: 0px;padding-top: 15px;\"></span><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a></p><p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a></p>&nbsp;", "About", "", "inherit", "open", "open", "", "20-autosave-v1", "", "", "2015-07-04 06:42:26", "2015-07-04 06:42:26", "", "20", "http://localhost/CISSA/index.php/2015/07/01/20-autosave-v1/", "0", "revision", "", "0");
