INSERT INTO `wp_posts` VALUES("140", "1", "2015-07-02 03:49:42", "2015-07-02 03:49:42", "[spacer height=\"50px\"]\r\n\r\n<strong>About CISSA</strong>\r\nThe Melbourne University Computing & Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. \r\nWe hold social events and industry talks regularly, this is the place where you will find out about future events first!\r\n\r\n<strong>Our Goals</strong>\r\n-Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n-Encourage students to further their education through technical events such as programming competitions.\r\n-Connect students with potential employers looking to meet high quality graduates.\r\n\r\n[spacer height=\"300px\"]", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-02 03:49:42", "2015-07-02 03:49:42", "", "20", "http://localhost/CISSA/index.php/2015/07/02/20-revision-v1/", "0", "revision", "", "0");
