INSERT INTO `wp_posts` VALUES("200", "1", "2015-07-03 04:15:12", "2015-07-03 04:15:12", "[spacer height=\"50px\"]\r\n\r\n<strong>About CISSA</strong>\r\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\r\n\r\n[spacer height=\"5px\"]\r\n\r\n<strong>Our Goals</strong>\r\n-Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n-Encourage students to further their education through technical events such as programming competitions.\r\n-Connect students with potential employers looking to meet high quality graduates.\r\n\r\n[spacer height=\"5px\"]\r\n\r\n<strong>Our Committee</strong>\r\n\r\n[table id=1 /]\r\n\r\n[spacer height=\"150px\"]", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-03 04:15:12", "2015-07-03 04:15:12", "", "20", "http://localhost/CISSA/index.php/2015/07/03/20-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("201", "1", "2015-07-03 04:15:32", "2015-07-03 04:15:32", "[spacer height=\"50px\"]\r\n\r\n<strong>About CISSA</strong>\r\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\r\n\r\n[spacer height=\"5px\"]\r\n\r\n<strong>Our Goals</strong>\r\n1.Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n2.Encourage students to further their education through technical events such as programming competitions.\r\n3. Connect students with potential employers looking to meet high quality graduates.\r\n\r\n[spacer height=\"5px\"]\r\n\r\n<strong>Our Committee</strong>\r\n\r\n[table id=1 /]\r\n\r\n[spacer height=\"150px\"]", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-03 04:15:32", "2015-07-03 04:15:32", "", "20", "http://localhost/CISSA/index.php/2015/07/03/20-revision-v1/", "0", "revision", "", "0");
