INSERT INTO `wp_posts` VALUES("218", "1", "2015-07-03 05:26:05", "2015-07-03 05:26:05", "<p>[spacer height=\"50px\"]</p><p><strong>About CISSA</strong><br> The Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!</p><p>[spacer height=\"5px\"]</p><p><strong>Our Goals</strong><br> 1.&nbsp;Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.<br> 2.&nbsp;Encourage students to further their education through technical events such as programming competitions.<br> 3. Connect students with potential employers looking to meet high quality graduates.</p><p>[spacer height=\"5px\"]</p><p><strong>Our Committee</strong></p><p>[table id=1 /]</p><p>[spacer height=\"150px\"]</p><p>[spacer height=\"15px\"]</p><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a></p><p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a></p>&nbsp;", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-03 05:26:05", "2015-07-03 05:26:05", "", "20", "http://localhost/CISSA/index.php/2015/07/03/20-revision-v1/", "0", "revision", "", "0");
