INSERT INTO `wp_posts` VALUES("263", "1", "2015-07-04 05:52:50", "2015-07-04 05:52:50", "<strong>About CISSA</strong>\r\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\r\n\r\n<strong>Our Goals</strong>\r\n1.Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n2.Encourage students to further their education through technical events such as programming competitions.\r\n3. Connect students with potential employers looking to meet high quality graduates.\r\n\r\n<strong>Our Committee</strong>\r\n\r\n[table id=1 /]\r\n<p class=\"affiliation\">Affiliations</p>\r\n<a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\" /></a>\r\n\r\n<a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\" /></a>\r\n\r\n&nbsp;", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-04 05:52:50", "2015-07-04 05:52:50", "", "20", "http://localhost/CISSA/index.php/2015/07/04/20-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("264", "1", "2015-07-09 04:24:20", "2015-07-09 04:24:20", "<p><span style=\"display:block;clear:both;height: 0px;padding-top: 10px;\"></span></p>\n<p><span class=\"home-making\">Upcoming Events</span>\n<p><a href=\"https://www.facebook.com/events/932158913503545/\"><img class=\"alignnone wp-image-265\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/codebrew.png\" alt=\"codebrew\" width=\"657\" height=\"243\"></a></p>\n<p style=\"text-align: center;\"><a href=\"https://www.facebook.com/events/932158913503545/\"><strong>CodeBrew</strong></a></p>\n<p>CodeBrew is a Melbourne-based weekend-long hackathon for university students run by CISSA. It will hosted on Friday, August 7 and at York Butter Factory, 66 King Street, Melbourne, Victoria, Australia 3000. <a href=\"http://codebrew.net.au/tickets\">Obtain tickets</a></p>\n<p><span style=\"display:block;clear:both;height: 0px;padding-top: 100px;\"></span><span style=\"display:block;clear:both;height: 0px;padding-top: 15px;\"></span></p>\n<p class=\"affiliation\">Affiliations</p>\n<p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a></p>\n<p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a></p>\n", "Events", "", "inherit", "open", "open", "", "24-autosave-v1", "", "", "2015-07-09 04:24:20", "2015-07-09 04:24:20", "", "24", "http://localhost/CISSA/index.php/2015/07/04/24-autosave-v1/", "0", "revision", "", "0");
