INSERT INTO `wp_posts` VALUES("284", "1", "2015-07-04 06:44:25", "2015-07-04 06:44:25", "<span style=\"display:block;clear:both;height: 0px;padding-top: 10px;\"></span>\r\n\r\n<span class=\"home-making\">Upcoming Events</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span><p><a href=\"https://www.facebook.com/events/932158913503545/\"><img class=\"alignnone wp-image-265\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/codebrew.png\" alt=\"codebrew\" width=\"657\" height=\"243\"></a></p><a href=\"https://www.facebook.com/events/932158913503545/\"><strong>CodeBrew</strong></a>\r\n<p>CodeBrew is a Melbourne-based weekend-long hackathon for university students run by CISSA. It will hosted on Friday, August 7 and at York Butter Factory, 66 King Street, Melbourne, Victoria, Australia 3000.  <a href=\"http://codebrew.net.au/tickets\">Obtain tickets</a></p><span style=\"display:block;clear:both;height: 0px;padding-top: 100px;\"></span><span style=\"display:block;clear:both;height: 0px;padding-top: 15px;\"></span>\r\n<p class=\"affiliation\">Affiliations</p>\r\n<a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a>\r\n\r\n<a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a>", "Events", "", "inherit", "open", "open", "", "24-revision-v1", "", "", "2015-07-04 06:44:25", "2015-07-04 06:44:25", "", "24", "http://localhost/CISSA/index.php/2015/07/04/24-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("285", "1", "2015-07-04 06:44:51", "2015-07-04 06:44:51", "<span style=\"display:block;clear:both;height: 0px;padding-top: 10px;\"></span>\r\n\r\n<span class=\"home-making\">About CISSA</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\nThe Melbourne University Computing &amp; Information Systems Students Association (CISSA) is a student club for University of Melbourne students who are either studying Computer Science, Software Engineering or Information Systems, or just generally have an interest in programming or Information Technology. We hold social events and industry talks regularly; we also offer discounted resources to assist students with their studies and promoting education about current and upcoming technology, this is the place where you will find out about future events first!\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n\r\n<span class=\"home-making\">Our Goals</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n1.&nbsp;Connect like-minded students through social events such as BBQs, Pizza lunches and Drinks.\r\n2.&nbsp;Encourage students to further their education through technical events such as programming competitions.\r\n3. Connect students with potential employers looking to meet high quality graduates.\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n\r\n<span class=\"home-making\">Our Committee</span>\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 5px;\"></span>\r\n\r\n[table id=1 /]\r\n\r\n<span style=\"display:block;clear:both;height: 0px;padding-top: 100px;\"></span><span style=\"display:block;clear:both;height: 0px;padding-top: 15px;\"></span><p class=\"affiliation\">Affiliations</p><p><a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\"></a></p><p><a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\"></a></p>&nbsp;", "About", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-07-04 06:44:51", "2015-07-04 06:44:51", "", "20", "http://localhost/CISSA/index.php/2015/07/04/20-revision-v1/", "0", "revision", "", "0");
