Validation for number type custom field\r\n            var value = jQuery(this).children(\'input\').val();\r\n			var value2 = jQuery.trim(value);\r\n            if (value == \"\" || value2== \"\") {\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n        });\r\n		\r\n		jQuery(\'.crf_select_required\').each(function (index, element) { //Validation for number type custom field\r\n            var value = jQuery(this).children(\'select\').val();\r\n			var value2 = jQuery.trim(value);\r\n            if (value == \"\" || value2== \"\") {\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n        });\r\n		\r\n		jQuery(\'.crf_textarearequired\').each(function (index, element) { //Validation for number type custom field\r\n            var value = jQuery(this).children(\'textarea\').val();\r\n			var value2 = jQuery.trim(value);\r\n            if (value == \"\" || value2== \"\") {\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n        });\r\n		\r\n		jQuery(\'.crf_checkboxrequired\').each(function (index, element) { //Validation for number type custom field\r\n		var checkboxlenght = jQuery(this).children(\'input[type=\"checkbox\"]:checked\');\r\n		\r\n        var atLeastOneIsChecked = checkboxlenght.length > 0;\r\n        if (atLeastOneIsChecked == true) {\r\n		}else{\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n		\r\n		});\r\n		\r\n		jQuery(\'.crf_termboxrequired\').each(function (index, element) { //Validation for number type custom field\r\n		var checkboxlenght = jQuery(this).children(\'input[type=\"checkbox\"]:checked\');\r\n		\r\n        var atLeastOneIsChecked = checkboxlenght.length > 0;\r\n        if (atLeastOneIsChecked == true) {\r\n		}else{\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n		\r\n		});\r\n		\r\n		jQuery(\'.crf_radiorequired\').each(function (index, element) { //Validation for number type custom field\r\n		var radiolenght = jQuery(this).children(\'input[type=\"radio\"]:checked\');\r\n		\r\n        var atLeastOneIsChecked = radiolenght.length > 0;\r\n        if (atLeastOneIsChecked == true) {\r\n		}else{\r\n                jQuery(this).children(\'.custom_error\').html(\'This is a required field.\');\r\n                jQuery(this).children(\'.custom_error\').show();\r\n            }\r\n		\r\n		});\r\n		\r\n        var b = \'\';\r\n        b = jQuery(\'.custom_error\').each(function () {\r\n            var a = jQuery(this).html();\r\n            b = a + b;\r\n            jQuery(\'.customcrferror\').html(b);\r\n        });\r\n        var error = jQuery(\'.customcrferror\').html();\r\n        if (error == \'\') {\r\n            return true;\r\n        } else {\r\n            return false;\r\n        }\r\n    });\r\njQuery(\'.input-box\').addClass(\'crf_input\');\r\njQuery(\'.lable-text\').addClass(\'crf_label\');\r\njQuery(\'.crf_required\').parent(\'.formtable\').children(\'.crf_label\').children(\'label\').append(\'<sup class=\"crf_estric\">*</sup>\');\r\njQuery(\'.crf_select_required\').parent(\'.formtable\').children(\'.crf_label\').children(\'label\').append(\'<sup class=\"crf_estric\">*</sup>\');\r\njQuery(\'.crf_radiorequired\').parent(\'.formtable\').children(\'.crf_label\').children(\'label\').append(\'<sup class=\"crf_estric\">*</sup>\');\r\njQuery(\'.crf_checkboxrequired\').parent(\'.formtable\').children(\'.crf_label\').children(\'label\').append(\'<sup class=\"crf_estric\">*</sup>\');\r\njQuery(\'.crf_textarearequired\').parent(\'.formtable\').children(\'.crf_label\').children(\'label\').append(\'<sup class=\"crf_estric\">*</sup>\');\r\n// ]]></script>You can also mail things to us here:\r\n\r\n<strong>PostalAddress:</strong>\r\n\r\n<strong>Computing and Information Systems Students Association</strong>\r\nC/O The Department of Computing and Information Systems\r\nLevel 8\r\nDoug McDonell Building\r\nThe University of Melbourne\r\nParkville 3010 VIC Australia\r\n<p class=\"affiliation\">Affiliations</p>\r\n<a href=\"http://unimelb.edu.au/\"><img class=\"alignnone  wp-image-208\" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/unimelb-300x99.jpg\" alt=\"unimelb\" width=\"200\" height=\"66\" /></a> <a href=\"http://umsu.unimelb.edu.au/clubs/computing-and-information-systems-students-association/\"><img class=\"alignnone wp-image-207 \" src=\"http://localhost/CISSA/wp-content/uploads/2015/07/affiliation2.jpg\" alt=\"affiliation2\" width=\"200\" height=\"102\" /></a>", "Contact Us", "", "inherit", "open", "open", "", "26-revision-v1", "", "", "2015-07-09 04:20:15", "2015-07-09 04:20:15", "", "26", "http://localhost/CISSA/index.php/2015/07/09/26-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("341", "1", "2015-07-09 04:22:27", "2015-07-09 04:22:27", "<p style=\"text-align: center;\"></p>\r\n<span class=\"home-making\">CISSA Membership Form</span>\r\n\r\n<!--HTML for displaying registration form--><form id=\"crf_contact_form\" action=\"\" enctype=\"multipart/form-data\" method=\"post\" name=\"crf_contact_form\"><input id=\"_wpnonce\" name=\"_wpnonce\" type=\"hidden\" value=\"fa372945b3\" /><input name=\"_wp_http_referer\" type=\"hidden\" value=\"/CISSA/wp-admin/admin-ajax.php?action=so_panels_import_layout&amp;_panelsnonce=12250f7c6e\" /> <input name=\"crf_timestamp\" type=\"hidden\" value=\"1436415745\" /> <input name=\"crf_key\" type=\"hidden\" value=\"14364157451\" /> <label for=\"user_login\">Username </label> <input id=\"user_name\" class=\"input\" name=\"user_name\" size=\"20\" type=\"text\" value=\"\" /> <label for=\"user_email\">E-mail </label> <input id=\"user_email\" class=\"input\" name=\"user_email\" size=\"25\" type=\"text\" value=\"\" /> <input id=\"inputPassword\" name=\"inputPassword\" type=\"hidden\" value=\"uehNDVa9inzl\" /> <input id=\"user_confirm_password\" name=\"user_confirm_password\" type=\"hidden\" value=\"uehNDVa9inzl\" /> <!-- HTML for displaying custom fields in Registration form --> <label for=\"studentnumber_2\">Student Number</label> <input id=\"studentnumber_2\" class=\"crf_number regular-text \" maxlength=\"\" name=\"studentnumber_2\" type=\"text\" value=\"\" /> <label for=\"firstname_3\">First Name</label> <input id=\"firstname_3\" class=\"regular-text \" maxlength=\"\" name=\"firstname_3\" type=\"text\" value=\"\" /> <label for=\"lastname_4\">Last Name</label> <input id=\"lastname_4\" class=\"regular-text \" maxlength=\"\" name=\"lastname_4\" type=\"text\" value=\"\" /> <label for=\"email_1\">Email</label> <input id=\"email_1\" class=\"regular-text \" maxlength=\"\" name=\"email_1\" type=\"text\" value=\"\" /> <label for=\"coursename_5\">Course Name</label> <input id=\"coursename_5\" class=